                        <CFade>
                          <route.component {...props} />
                        </CFade>
                      )}
                    />
                  )
                );
              })}

              {/* <Redirect from="/" to="/items" /> */}
            </Switch>
          </Suspense>
        </CContainer>{" "}
        */}
      </main>
    </>
  );
};
export default Home;
